import { createSlice } from '@reduxjs/toolkit';

const coursesSlice = createSlice({
  name: 'course',
  initialState: {
    coursesList: [],
    flitersList: [],
    filterBy: 'popular'
  },
  reducers: {
    setF
  }
});

export const coursesActions = coursesSlice.actions;
export default coursesSlice;
